// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

interface IEVoting {
    function isVoterRegistered(uint votingId, address voter) external view returns (bool);
}

contract VotingToken is ERC20, Ownable {
    uint256 public claimAmount = 1 * 10 ** 18; // 1 token (1 VTK)
    mapping(uint => mapping(address => bool)) public hasClaimed; // Klaim per votingId
    bool public claimActive = true;
    IEVoting public eVotingContract;
    uint public activeVotingId;
    address public eVotingAddress; // Alamat kontrak EVoting

    event ClaimedVotingToken(address indexed user, uint indexed votingId, uint256 amount);
    event ClaimStatusChanged(bool status);
    event TransferRestricted(address indexed from, address indexed to, uint256 amount);
    event ClaimReset(address indexed user, uint indexed votingId);
    event EVotingContractSet(address indexed eVotingContract);
    event ActiveVotingIdSet(uint indexed votingId);

    constructor(address _eVotingContract) ERC20("VotingToken", "VTK") Ownable(msg.sender) {
        _mint(address(this), 5000 * 10 ** 18); // Fixed supply: 5000 VTK
        eVotingAddress = _eVotingContract;
        eVotingContract = IEVoting(_eVotingContract);
        emit EVotingContractSet(_eVotingContract);
    }

    function setEVotingContract(address _eVotingContract) public onlyOwner {
        require(_eVotingContract != address(0), "Alamat tidak valid.");
        eVotingAddress = _eVotingContract;
        eVotingContract = IEVoting(_eVotingContract);
        emit EVotingContractSet(_eVotingContract);
    }

    function setActiveVotingId(uint _votingId) external {
        require(msg.sender == eVotingAddress, "Hanya EVoting yang dapat mengatur voting ID aktif.");
        require(_votingId > 0, "Voting ID harus lebih dari 0.");
        activeVotingId = _votingId;
        emit ActiveVotingIdSet(_votingId);
    }

    function claimVotingTokens(uint _votingId) public {
        require(claimActive, "Klaim dinonaktifkan.");
        require(_votingId == activeVotingId, "Voting ID tidak aktif.");
        require(!hasClaimed[_votingId][msg.sender], "Anda sudah mengklaim token untuk voting ini.");
        require(eVotingContract.isVoterRegistered(_votingId, msg.sender), "Anda bukan pemilih terdaftar.");
        require(balanceOf(address(this)) >= claimAmount, "Token habis.");

        hasClaimed[_votingId][msg.sender] = true;
        _transfer(address(this), msg.sender, claimAmount);

        emit ClaimedVotingToken(msg.sender, _votingId, claimAmount);
    }

    function _update(address from, address to, uint256 amount) internal override {
        if (from != address(0) && to != address(0)) {
            require(from == owner() || to == owner() || from == address(this) || to == address(this), "Token tidak dapat ditransfer.");
            emit TransferRestricted(from, to, amount);
        }
        super._update(from, to, amount);
    }

    function toggleClaim(bool status) public onlyOwner {
        claimActive = status;
        emit ClaimStatusChanged(status);
    }

    function resetClaimStatus(address user, uint _votingId) public onlyOwner {
        require(claimActive, "Klaim dinonaktifkan.");
        hasClaimed[_votingId][user] = false;
        emit ClaimReset(user, _votingId);
    }

    function setClaimAmount(uint256 _claimAmount) public onlyOwner {
        claimAmount = _claimAmount;
    }
}
